import React from 'react';
import './App.css';
import SearchButton from './components/SearchButton';
import Random from './components/Random';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Get a Life</h1>
        <Random /> <Searchbutton /> 
      </header>
    </div>
  );
}

export default App;
